import json
from rest_framework import status
from rest_framework.test import APITestCase
from samplstakapi.models import Drumkit, Producer, Genre
from rest_framework.authtoken.models import Token


class DrumkitTests(APITestCase):

    fixtures = ['users', 'tokens', 'producers', 'genres']

    def setUp(self):
        self.producer = Producer.objects.first()
        token = Token.objects.get(user=self.producer.user)
        self.client.credentials(HTTP_AUTHORIZATION=f"Token {token.key}")

    def test_get_drumkit(self):
        """
        Ensure we can get a single drumkit
        """

        producer = Producer(pk=1)
        genre = Genre(pk=3)

        drumkit = Drumkit()
        drumkit.name = "OLIVER POWER TOOLS III"
        drumkit.producer = producer
        drumkit.image = "img/1623687782.webp"
        drumkit.genre = genre
        drumkit.save()

        response = self.client.get(f"/drumkits/{drumkit.id}")

        json_response = json.loads(response.content)

        self.assertEqual(response.status_code, status.HTTP_200_OK)

        self.assertEqual(json_response["name"], "OLIVER POWER TOOLS III")
        self.assertEqual(json_response["image"], "/media/img/1623687782.webp")

    def test_create_drumkit(self):
        """
        Ensure we can create a new drumkit.
        """
        url = "/drumkits"

        # Define the request body
        data = {
            "name": "NIKOOO Drumz 4 Goonz",
            "producer": 1,
            "image": "data:image/webp;base64,",
            "genre": 2,
        }

        # Initiate request and store response
        response = self.client.post(url, data, format='json')

        # Parse the JSON in the response body
        json_response = json.loads(response.content)

        # Assert that the game was created
        self.assertEqual(response.status_code, status.HTTP_201_CREATED)

        # Assert that the properties on the created resource are correct
        self.assertEqual(json_response["name"], "NIKOOO Drumz 4 Goonz")
        self.assertEqual(json_response["producer"]["id"], 1)
        self.assertEqual(json_response["producer"]["bio"], "Me")
        self.assertEqual(json_response["producer"]["full_name"], "Carrie Belk")
        self.assertEqual(json_response["genre"]["id"], 2)
        self.assertEqual(json_response["genre"]["label"], "Hip-Hop")
